            "description": "วันที่ 10 พฤษภาคม 2565 ยังเป็นคดีที่สังคมให้ความสนใจ สำหรับคดีของ แตงโม ภัทรธิดา (นิดา) ซึ่งวันนี้มีประเด็นที่พยานบุคคลบนเรือจำนวน 1 ราย พบสารกลุ่มเบนโซไดอาซิปินส์ ชนิด Alprazolam หรือ ยาเสียสาวว่าพบ Alprazolam หรือ ยาเสียตัว ในพยานบุคคลบนเรือ 1 ราย ตามที่เสนอข่าวไปแล้วนั้น (คดี'แตงโม นิดา'ล่าสุด พบ Alprazolam หรือ 'ยาเสียสาว' ในพยานบุคคลบนเรือ 1 ราย) ล่าสุดนายษิทรา เบี้ยบังเกิด ทนายความ ได้โพสต์ข้อความระบุว่า วันนี้มีประเด็นร้อนที่น่าสนใจ หลังตำรวจเปิดเผยว่าตรวจพบยาเสียสาวในพยานบุคคล 1 ในห้าที่อยู่บนเรือคดีแตงโม ก่อนหน้านี้ ผมเป็นคนเปิดแชตลับลงในสื่อหลายหัว ว่ามีคนส่งข้อมูลหลักฐานมาว่า คนบนเรือบางคน เคยก่อเหตุมอมสาวแบบนี้มาก่อน ผมไม่อาจตอบได้ ว่าบุคคลนั้นเป็นใคร และเป็นคนเดียวกับที่อยู่บนเรือไหม แต่ในเมื่อคุณมียาแบบนี้อยู่ในกระแสเลือด ในวันที่เพื่อนของคุณเสียชีวิตแบบเป็นปริศนา คุณควรออกมาชี้แจงสังคม ว่าคุณใช้ยาตัวนี้ด้วยจุดประสงค์อะไร เพื่อรักษาอาการนอนไม่หลับ? เพื่อรักษาอาการวิตกกังวล? ซึ่งถ้าเป็นกรณีนี้คุณต้องมีใบสั่งจากแพทย์ เพราะเป็นยาควบคุม ถ้าไม่มีก็อดกังวลใจไม่ได้ ว่าใช้เพื่อเป็นยาเสพติดหรือเพื่อหวังผลทำอะไรคนบนเรือ",
