            "link": "https://www.naewna.com/local/652480",
            "keywords": null,
            "creator": null,
            "video_url": null,
            "description": "วันที่ 10 พฤษภาคม2565 เวลา 10.00 น. นายอัจฉริยะ เรืองรัตนพงษ์ ประธานชมรมช่วยเหลือเหยื่ออาชญากรรม ยื่นหลักฐานแจ้งความเอาผิด แพทย์นิติเวช โรงพยาบาลตำรวจ ที่ร่วมชันสูตรฯ คดีการเสียชีวิตของนางสาวภัทรธิดา พัชรวีระพงษ์ หรือ แตงโม ชี้เข้าข่ายเป็นการกระทำที่มีการลงนามรับรองเอกสารราชการอันเป็นเท็จ นายอัจฉริยะ เรื่องรัตนพงษ์ประธานชมรมช่วยเหลือเหยื่ออาชญากรรม เข้าพบพลตำรวจตรีจรูญเกียรติ ปานแก้ว ผู้บังคับการกองบังคับการป้องกันปราบปรามการทุจริตและประพฤติมิชอบ หรือ ปปป. เพื่อแจ้งความต่อพนักงานสอบสวนให้ดำเนินคดีกับ พันตำรวจเอก แพทย์หญิง ณปภัช ณัฏฐสุมน นายแพทย์ (สบ.5) หัวหน้ากลุ่มงานตรวจพิสูจน์หลักฐานเกี่ยวกับบุคคล สถาบันนิติเวชวิทยา โรงพยาบาลตำรวจ และผู้ที่เกี่ยวข้องกับการชันสูตรฯ คดีการเสียชีวิตของนางสาวภัทรธิดา พัชรวีระพงษ์ หรือ แตงโม ในความผิดตามประมวลกฎหมายอาญามาตรา 157 และมาตรา 335 (6) ผู้ใดลักทรัพย์โดยลวงว่าเป็นเจ้าพนักงานและความผิดตามประมวลกฏหมายอาญาอื่นๆที่เกี่ยวข้อง คือ มาตรา 161 ที่ระบุเกี่ยวข้องกับการเป็นเจ้าพนักงาน มีหน้าที่ทำเอกสาร ฯ กระทำการปลอมเอกสารโดยอาศัยโอกาสที่ตนมีหน้าที่นั้น และมาตรา 162 (1) ที่ระบุว่า เป็นเจ้าพนักงาน มีหน้าที่ทำเอกสาร รับเอกสารหรือกรอกข้อความลงในเอกสาร กระทำการรับรองเป็นหลักฐาน อันเป็นความเท็จและความผิดตามประมวลกฎหมายอาญามาตรา 264 และมาตรา 265 ที่เกี่ยวกับการปลอมแปลงเอกสารราชการ รวมทั้ง ความผิดตามประมวลกฎหมายอาญา มาตรา 269 เกี่ยวกับการเป็นแพทย์ ทำคำรับรองเป็นเอกสารอันเป็นเท็จ นายอัจฉริยะ เปิดเผยว่า วันนี้แจ้งความร้องทุกข์กล่าวโทษเฉพาะกลุ่มแพทย์และพวก ส่วนจะมีกี่คนขึ้นอยู่กับพนักงานสอบสวน ในการรวบรวมพยานหลักฐาน โดนยังคงย้ำว่า บาดแผลทางยาวขาข้างขวาของแตงโม ไม่ได้เกิดจากใบพัดเรือ แต่แพทย์กลับลงความเห็นว่า เกิดจากใบพัดเรือ จึงเป็นสิ่งที่ไม่เป็นความจริง นายอัจฉริยะ ยังนำหลักฐานข้อความสนทนา ที่อ้างว่าเป็นนายตำรวจนามเรียกขานว่า ไอยรา 4 ที่ยอมรับว่า การนำหมูไปจำลองเหตุการณ์ 10 ครั้ง ทำได้แค่ครั้งเดียว ที่หมูจะหลุดเข้าไปในใบพัดเรือ โดยข้อความสนทนานี้ บุคคลที่ใช้นามเรียกขานว่า ไอยรา 4 ส่งต่อให้กับบุคคลภายนอกที่ไม่เกี่ยวข้องกับคดี ซึ่งข้อมูลดังกล่าวนี้ อาจนำไปสู่การทำพยานหลักฐานเท็จ ส่วนบุคคลที่ใช้นามเรียกขานว่าไอยรา 4 จะเป็นบุคคลเดียวกับนายตำรวจอักษรย่อ ว.หรือไม่ ขอให้สื่อมวลชนไปสอบถาม นายตำรวจในสังกัดกองบัญชาการตำรวจภูธรภาค 1 จะทราบดีว่าเป็นใคร นาย​อัจฉริยะ​ ยังแสดงความแปลกใจ ที่ทีมโฆษกสำนักงานตำรวจแห่งชาติออกมาแถลงยืนยันว่า พนักงานสอบสวน สอบสวนเพิ่มเติมแล้วเสร็จตามที่พนักงานอัยการ ส่งสำนวนมาให้สอบในประเด็นต่างๆเพิ่มเติมอีก 20 ประเด็น เพื่อประกอบสำนวนคดีให้มีความรัดกุม ซึ่งนายอัจฉริยะ ตั้งข้อสังเกตว่า การสอบสวนเพิ่มเติม 20 ประเด็นดังกล่าว มีการสอบสวนที่เร่งรีบเกินไป หรือไม่ นายอัจฉริยะ ยังย้ำว่า การนำข้อมูลต่างๆมาเผยแพร่ ไม่ใช่การลดความน่าเชื่อถือการทำงานของพนักงานสอบสวนคดีแตงโม แต่ปัจจุบันการเสาะแสวงหาข้อมูลข่าวสารในสื่อสังคมออนไลน์รวดเร็ว กว่าการทำงานของตำรวจ ซึ่งข้อมูลหลักฐานต่างๆที่นำเสนอนั้น เพื่อยืนยันว่า ข้อสังเกตที่สังคมสงสัย และไม่เชื่อว่า แตงโมปัสสาวะท้ายเรือ และแตงโม ตกจากท้ายเรือ เป็นไปไม่ได้",
