            "title": "‘ชัยวุฒิ’เล็งขยายผลลงดาบปิดแพลตฟอร์มหมิ่นสถาบัน",
            "link": "https://www.naewna.com/politic/652481",
            "keywords": null,
            "creator": null,
            "video_url": null,
            "description": "ชัยวุฒิ เล็งขยายผลปิดแพลตฟอร์มหมิ่นสถาบัน แนะ สมาคมวิชาชีพคุมกันเอง รัฐบาลไม่ยุ่ง ชี้ต่างชาติทำอะไรต้องเคารพความรู้สึกคนไทย เมื่อวันที่ 10 พฤษภาคม 2565 เวลา 09.50 น. ที่ทำเนียบรัฐบาล นายชัยวุฒิ ธนาคมานุสรณ์ รมว.ดิจิทัลเพื่อเศรษฐกิจและสังคม (ดีอีเอส) ให้สัมภาษณ์ถึงความคืบหน้าตรวจสอบเว็บไซต์และแพลตฟอร์มที่มีการนำเสนอโฆษณาด้านการตลาดในลักษณะที่ก้าวล่วงสถาบันของลาซาด้าและที่คล้ายกันว่า ขณะนี้เรากำลังรวบรวมพยานหลักฐานและทำงานร่วมกับกองบังคับการปราบปรามการกระทำความผิดเกี่ยวกับอาชญากรรมทางเทคโนโลยี (ปอท.) ซึ่งได้ดำเนินคดีไปแล้ว นอกจากนี้ยังมีคำสั่งไปที่ศาล เพื่อขอให้ปิดกั้นการเข้าถึงแพลตฟอร์ม รวมถึงการแชร์ผ่านยูทูป ทวิตเตอร์​และเฟซบุ๊กเบื้องต้นพบทั้งหมด 42 ยูอาร์แอล อย่างไรก็ตามโดยปกติหากแพลตฟอร์มเหล่านี้ได้รับการแจ้งจากดีอีเอส จะมีการปิดตัวเองอยู่แล้ว เพราะหากไม่ปิดจะมีความผิด คือเป็นผู้ร่วมกระทำความผิดตามพระราชบัญญัติว่าด้วยการกระทำความผิดเกี่ยวกับคอมพิวเตอร์และกฎหมายอื่น เมื่อถามว่า ขณะนี้มีการสั่งปิดกี่ยูอาร์แอลแล้ว นายชัยวุฒิ กล่าวว่า กำลังตรวจสอบอยู่ แต่คาดว่าน่าจะสามารถปิดได้เกือบทั้งหมด เพราะมีความผิดชัดเจน เมื่อถามว่า จะมีมาตรการป้องกันไม่ให้เกิดกรณีแบบนี้อีกอย่างไร นายชัยวุฒิ กล่าวว่า สิ่งที่สำคัญที่สุด เอเจนซี่โฆษณา อินฟลูเอนเซอร์และผู้ที่อยู่ในวงการประชาสัมพันธ์ต้องมีจรรยาบรรณ​และมีสมาคมวิชาชีพดูแล เพื่อหารือกันว่าการทำโฆษณาต้องถูกกฎหมาย ไม่ผิดศีลธรรม ไม่บูลลี่ หรือทำให้สังคมเกิดความรู้สึกไม่ดี จึงต้องมีการกำกับดูแลระหว่างกัน หากให้หน่วยงานหรือรัฐบาลไปสั่งก็คงไม่เหมาะสม เพราะเป็นสิทธิเสรีภาพในการแสดงความคิดเห็นตามรัฐธรรมนูญ แต่ก็อยากให้เคารพกฎหมายและเป็นไปตามบริบทที่สังคมไทยรับได้ อะไรที่สังคมไทยรับไม่ได้ ก็อยากไปทำ หากไปทำอะไรที่ขัดความรู้สึกคนไทย สุดท้ายธุรกิจทำโฆษณาก็จะเสียหายเอง เมื่อถามว่า การที่หน่วยงานรัฐหลายหน่วยงานออกมาแบนลาซาด้า จะกระทบต่อภาพลักษณ์และความสัมพันธ์ระหว่างประเทศหรือไม่ เพราะสื่อต่างประเทศรายงานเรื่องนี้ นายชัยวุฒิ กล่าวว่า ตนคิดว่า เรื่องนี้เป็นสิทธิของคนไทย และองค์กรต่างๆ ที่จะตอบโต้การกระทำที่ไม่เหมาะสม ทั้งลาซาด้าและแพลตฟอร์มอื่นๆ ที่ใช้ช่องทางโซเชียลมีเดียในทางที่ไม่เหมาะสม ถ้าไม่ตักเตือนและส่งสัญญาณว่าเราไม่เห็นด้วย ก็จะมีการทำแบบนี้กันอีกไม่จบไม่สิ้น เราจึงต้องส่งสัญญาณให้ภาคธุรกิจและต่างชาติรับรู้ว่า คนไทยรับไม่ได้กับสิ่งเหล่านี้ และให้หยุดการกระทำอย่ามาทำแบนี้ในประเทศไทย เมื่อถามว่า กังวลหรือไม่ว่าจะกระทบความสัมพันธ์เพราะลาซาด้าเป็นแพตฟอร์มจากประเทศจีน นายชัยวุฒิ กล่าวว่า ก็ต้องคิดถึงคนไทยเหมือนกัน จะคิดว่า อยากทำอะไรก็ได้มันไม่ถูก เป็นคนจีนก็ต้องเคารพกฎหมายไทยและความรู้สึกของไทย เมื่อถามว่า เอเจนซี่ผู้จัดทำโฆษณาจะมีความผิดมากกว่าลาซาด้าใช่หรือไม่ นายชัยวุฒิ กล่าวว่า ตนคิดว่า ในหลักการ ต้องเริ่มจากการตรวจสอบเอเจนซี่ผู้จัดทำโฆษณา เพราะแพลตฟอร์ม อี คอมเมิร์ซไม่ได้เป็นผู้จัดทำโฆษณา อย่างไรก็ตามจำเป็นต้องมีอัลกอริทึมและกฎหมายป้องกันและแก้ไขให้ทันในส่วนนี้ด้วยเช่นกัน ไม่ใช่รอจนคนไทยด่าทั้งประเทศแล้วค่อยมาแก้ - 004",
