            "title": "ลากคอลูกเลี้ยง สารภาพสังหาร2ศพคาบ้าน ปมแค้นได้มรดกน้อย",
            "link": "https://www.naewna.com/local/652479",
            "keywords": null,
            "creator": null,
            "video_url": null,
            "description": "จ.ร้อยเอ็ด คืบหน้าฆ่าปาดคอ 2 ศพยาย-หลาน ที่แท้เป็น 'ลูกเลี้ยง'ที่ก่อเหตุ สารภาพปมแบ่งมรดกให้น้อย ทำไปด้วยอารมณ์ชั่ววูบ 10 พ.ค.65 คืบหน้า กรณีเหตุฆ่ากันตายที่บ้านเลขที่ 176 หมู่ 12 ต.หนองพอก อ.หนองพอก จ.ร้อยเอ็ด จึงรายงานให้ผู้บังคับบัญชาทราบแล้วรุดไปยังที่เกิดเหตุทันที ด้านตำรวจภูธรจังหวัดร้อยเอ็ด ภายใต้การนำของ ผู้บังคับการตำรวจภูธรจังหวัดร้อยเอ็ด มอบหมายให้ พ.ต.อ.สมพาน มุทาพร ผกก.สืบสวน ภ.จว.ร้อยเอ็ด ร่วมกับชุดสืบ สภ.หนองพอก สืบสวนออกหาข่าวและติดตามจับกุมคนร้าย ช่วงเกิดเหตุ นายธนาวัฒน์ หรือ อาร์ต จันทะโยธา อายุ 33 ปี ซึ่งเป็นลูกติดมากับสามีของนางสุบรรณ (อดีตตำรวจซึ่งเสียชีวิตแล้ว) และเลี้ยงมาตั้งแต่เล็กและเปิดร้านขายดอกไม้ให้ในตัวอำเภอ ซึ่งหลังเกิดเหตุก็ไม่พบ นายธนาวัฒน์ อยู่ที่บ้าน ต่อมาเจ้าหน้าที่ตำรวจจึงเกิดความสงสัยว่า นายธนาวัฒน์ จะรู้เห็นเหตุการณ์ในครั้งนี้หรือไม่ จึงจะติดตามตัวมาสอบปากคำที่ สภ.หนองพอก ข่าวที่เกี่ยวข้อง : เหี้ยม! ฆ่าปาดคอยาย-หลานดับสยองคาบ้าน คาดฝีมือลูกเลี้ยงแค้นแบ่งมรดก ต่อมา นายธนาวัฒน์ หรือ อาร์ต จันทะโยธา อายุ 33 ปี (ลูกเลี้ยง) ซึ่งเป็นผู้ต้องสงสัยในที่สุดก็ยอมรับสารภาพเป็นคนลงมือก่อเหตุ พาไปจุดที่ทิ้งเสื้อ-กางเกงที่เปื้อนเลือดที่ถอดทิ้งริมถนนเชื่อมหมู่บ้านโคกนาคำ ม.7-บ้านฉวะ ม.5 ต.หนองพอก อ.หนองพอก สารภาพสาเหตุเกิดจากความแค้น เรื่องขอแบ่งปืนพกของพ่อที่เป็นตำรวจที่เสียชีวิตแล้วไม่ได้ น้องสาว (ผู้ตาย) อ้างว่า ขายกินไปแล้วและที่ดิน ผู้ตายบอกว่าอยากได้ที่ดินมรดกให้ไปฟ้องเอา พ่อตายก็ยึดเอาที่ดิน ไม่ยอมแบ่งปันให้ บ่ายเบี่ยงมาโดยตลอด เป็นต้นเหตุให้สังหารโหดดังกล่าว ยอมรับว่าลงมือคนเดียว ด้วยอารมณ์ชั่ววูบและยอมรับผิดดังกล่าว -009",
