        {
            "title": "‘อนุทิน’ออกโรง!ยันไม่มีเปลี่ยนขั้ว ย้ำภูมิใจไทยหนุน‘บิ๊กตู่’",
            "link": "https://www.naewna.com/politic/652475",
            "keywords": null,
            "creator": null,
            "video_url": null,
            "description": "อนุทิน ยันภูมิใจไทย หนุนบิ๊กตู่แจงสมัยอภิสิทธิ์ถูกถีบไม่ได้ย้ายขั้ว สวนโหร วันชัย เปิดร้านหมอดูยังไงก็เจ๊ง เมื่อวันที่ 10 พฤษภาคม 2565 เวลา09.00 น. ที่ทำเนียบฯ นายอนุทิน ชาญวีรกูล รองนายกรัฐมนตรีและรมว.สาธารณสุขในฐานะ หัวหน้าพรรคภูมิใจไทย ให้สัมภาษณ์ กรณีนายวันชัย สอนศิริ วุฒิสภา ออกมาทำนายว่าพรรคภูมิใจไทย และ พรรคประชาธิปัตย์ อาจเปลี่ยนขั้วทางการเมืองว่า ไม่มี ถ้าไปเปิดร้านหมอดูก็เจ๊งกันหมดพอดี เปลี่ยนขั้วได้อย่างไร อยู่กันมาถึงขนาดนี้ การทำงานก็เป็นไปได้ด้วยดี ความเห็นต่างเกิดขึ้นได้ แต่สุดท้ายทุกคนเคารพกติกา เมื่อถามว่ามองบทบาทส.ว.อย่างไรที่มาวิจารณ์การเมือง นายอนุทิน กล่าวว่า จริงๆแล้วหน้าที่ใครหน้าที่มันมากกว่า ถ้าตนบอกสิ่งที่คิดในใจไปเดี๋ยวก็ทะเลาะกันตาย อย่าพูดดีกว่า ถ้าคนอื่นโดนแล้วเขาคิดอย่างไรก็พอกัน มนุษย์เหมือนกันเพียงแต่พูดหรือไม่พูด แต่เรามาจากพี่น้องประชาชน และพี่น้องประชาชนเลือกเรา เมื่อถามว่า พรรคภูมิใจไทยจะเซอร์ไพรส์อะไรในสภาฯหรือไม่ นายอนุทินบอกว่า ไม่มี เมื่อถามว่าเสียงรัฐบาลยังมี270 เสียงหรือไม่ นายอนุทิน กล่าวว่า เสียงรัฐบาลเท่าไหร่ไม่รู้ แต่เสียงพรรคภูมิใจไทยมีหลายเสียงอยู่ พร้อมให้การสนับสนุนรัฐบาล และ นายกฯ พร้อมให้การสนับสนุนเรื่องที่ถูกต้อง เมื่อถามว่า มีใครมาทาบทามให้ล้มนายกฯหรือไม่ นายอนุทิน กล่าวว่า ไม่มี ตนคิดว่าแนวทางปฏิบัติของพรรคภูมิใจไทยสไตล์การทำงานและสปิริตของการอยู่ร่วมกันไม่มีใครมาหา และที่ผ่านมาตนไม่เคยมีปัญหาอะไรเลยและไม่อยากมีปัญหาด้วย ผู้สื่อข่าวถามว่าอย่างในอดีตที่ผ่านมา นายอนุทิน กล่าวสวนทันที ว่า ว่าเป็นครั้งๆไป เมื่อถามย้ำว่าในอดีตพรรคภูมิใจไทยเคยเปลี่ยนขั้วในสภาฯมาแล้ว นายอนุทิน กล่าวว่า พรรคภูมิใจไทย ไม่เคยเปลี่ยนขั้ว สมัยรัฐบาลอภิสิทธิ์ ตอนนั้นไม่ใช่การเปลี่ยนขั้ว ตอนนั้นพรรคพลังประชาชนยุบไปและเราถูกถีบออกมา ไม่ได้เปลี่ยนขั้วเราแค่ต้องไปหาบ้านอยู่ตอนนั้นวิ่งแทบจะไม่มีที่อยู่ อนาคตเป็นอย่างไรก็ไม่รู้มืดมนไปหมด โชคดีที่เรามาจากพื้นเพที่ไม่ยอมแพ้อะไรง่ายๆ แล้วเราก็ก่อร่างสร้างตัวมาจนถึงทุกวันนี้ - 004",
