            "description": "จุรินทร์สยบข่าวลือพรรคประชาธิปัตย์ ถอนตัวพรรคร่วมรัฐบาล ยันไม่ทิ้งกลางคัน รู้หน้าที่ดีต้องสนับสนุนรัฐบาลแก้วิกฤติประเทศ เมื่อวันที่ 10 พฤษภาคม 2565 เวลา 09.30 น. ที่ทำเนียบรัฐบาล นายจุรินทร์ ลักษณวิศิษฏ์ รองนายกรัฐมนตรี และรมว.พาณิชย์ ในฐานะหัวหน้าพรรคประชาธิปัตย์ ให้สัมภาษณ์ถึงกรณีที่มีกระแสข่าวพรรคประชาธิปัตย์จะถอนตัวจากพรรคร่วมรัฐบาล ว่า เรารู้หน้าที่ดี เพราะเป็นพรรคร่วมรัฐบาล ต้องทำหน้าที่ในการที่จะสนับสนุนรัฐบาล ในการที่จะให้เดินหน้าทำงานเพื่อประโยชน์ของประเทศกับประชาชนต่อไป ให้ดีที่สุด วันนี้ก็มีปัญหาวิกฤติซ้อนวิกฤตหลายเรื่อง ไม่ว่าจะเป็น โควิด-19 ก็ยังไม่หมดไปเสียทีเดียว วิกฤติเศรษฐกิจก็เป็นทั่วโลก และปัญหาการเมืองมันก็ซ้ำซ้อนเข้ามา สงครามยูเครน-รัสเซีย ก็ซ้ำซ้อนเข้ามา เพราะฉะนั้นเราก็ต้องจับมือกัน ที่จะเข้าไปแก้ปัญหา เพราะถ้าไปทิ้งกลางคันตอนนี้มันก็ไปสร้างปัญหาอีกมุมหนึ่ง เพราะฉะนั้นในฐานะพรรคร่วมรัฐบาลจะทำหน้าที่ของเราให้ดีที่สุด พรรคประชาธิปัตย์ทำงานร่วมกับรัฐบาล ก็ต้องสนับสนุนรัฐบาล พรรคประชาธิปัตย์มีหลักชัดเจน ถ้าไม่ได้เป็นรัฐบาลเราก็มีหน้าที่ตรวจสอบรัฐบาล ตนได้ย้ำอยู่เสมอ เรารู้หน้าที่ของเรา ว่าเราต้องทำอะไร หัวหน้าพรรคประชาธิปัตย์ กล่าว - 004",
