            "link": "https://www.naewna.com/lady/652469",
            "keywords": null,
            "creator": null,
            "video_url": null,
            "description": "ท่านที่เกิดวันอาทิตย์ อิทธิพลของไพ่อัศวินถือหรียญ (Knight of Pentacles) วันนี้การค้าขายเริ่มไปได้ดีขึ้น และคนทำงานประจำผลงานจะชัดเจนขึ้นอย่างชัดเจน เงินทองคล่องมือมีลาภลอยเข้ามาอย่างไม่คาดฝัน​ ทำให้เงินทองเดินสะพัดอย่างน่าพอใจ ความรักมีงอนกันบ้างจากความหึงหวง ท่านที่เกิดวันจันทร์ อิทธิพลของไพ่ 10 ถ้วย (Ten of Cups) วันนี้เงินทองเข้ามาแต่ไม่มากดังลุ้น โชคลาภการเสี่ยงอย่าคาดหวังมากเกิน และคนที่เป็นเจ้าหนี้จะเครียดเพราะโดนเบี้ยว ด้านการงานให้ระวังเรื่องส่วนตัวจะทำให้โดนโจมตี ส่วนที่เป็นเจ้านายตนเองกิจการทรงๆ ความรักให้ระวังปัญ หาจากพี่น้องจะทำให้รักร้าว ท่านที่เกิดวันอังคาร อิทธิพลของไพ่โลก (The World) วันนี้เงินทองสิ่งของมีค่าจะได้มาดังลุ้น หลังจากรอลุ้นมานานความรักเข้าใจกันหลังจากมีปัญหาทะเลาะกันมาบ่อย​ ด้านการงานผลงานดีทำให้มั่นใจมีความสุขในการทำงาน งานส่วนตัวไปได้ดีเพราะผู้ใหญ่สนับสนุน ท่านที่เกิดวันพุธ อิทธิพลของไพ่ 2 ถ้วย (Two of Cups) วันนี้ความรักดีขึ้นเพราะปรับตัวเข้าหากับแฟนได้ ทำให้หายเครียดกังวลใจ เงินทองพอมีเข้ามาให้หมุนเวียน ทำให้ใจเป็นสุข งานที่คั่งค้างจะทำได้สำเร็จ คนที่มองหางานใหม่เริ่มมีเเววจะได้งาน ท่านที่เกิดวันพฤหัสบดี อิทธิพลของไพ่ 9 เหรียญ (Nine of Pentacles) วันนี้เงินทองก้อนใหญ่มีเข้ามา ทำให้หมุนเวียนได้คล่องมือ ความรักมีปัญหาเล็กน้อยเหตุเพราะเรื่องเวลานัดหมาย งานดีมีผลงานเป็นที่ชื่นชมของเจ้านาย งานส่วนตัวมีผู้ใหญ่ส่งเสริมทำให้มีแววรุ่ง ท่านที่เกิดวันศุกร์ อิทธิพลของไพ่ 8 ดาบ ( Eight of Swords) วันนี้งานประจำมีปัญหาจุกจิกเล่นเอาเครียด งานส่วนตัวมีปัญหาเข้าใจกันผิดกับลูกค้า ความรักเหตุเพราะความหึงหวง ทำให้มีความขัดแย้งกัน เงินทองหนี้สินเก่าๆจะถูกทวงถาม คนที่เล่นหุ้นถ้าโลภมากจะเดือดร้อน ท่านที่เกิดวันเสาร์ อิทธิพลของไพ่ราชาถือเหรียญ (King of Pentacles) วันนี้เงินทองเดินสะพัดและบางรายจะมีลาภลอยเข้ามาอย่างไม่คาดฝัน ด้านการงานทำผลงานได้ดีตามที่เจ้านายมอบหมาย ค้าขายเริ่มดีขึ้นอย่างน่าพอใจ ความรักให้ระวังปัญหาจากเรื่องเดิมๆ คนเก่าๆจะสร้างปัญหาให้รักเครียด ท่านผู้อ่านที่มีความประสงค์ ต้องการปรึกษา เรื่องดวงชะตาเป็นการส่วนตัว กับ อาจารย์ กิติคุณ พลวัน สอบถามรายละเอียดเพิ่มเติมได้ที่094-6298799",
