            "description": "ตำรวจดอนเจดีย์ สุพรรณบุรี วิสามัญเอเย่นต์ยาบ้า เหิมยิงตำรวจ ตาย 1 เจ็บ 1 ผู้สื่อข่าวรายงานว่าเมื่อเวลา22.00น. วันที่ 9 พ.ค.65 ร.ต.อ.ปฏิภณ รัตนประยูรรอง สว.(สอบสวน) สภ.ดอนเจดีย์ จ.สุพรรณบุรี ได้รับแจ้งมีเหตุยิงกันและมีผู้บาดเจ็บและเสียชีวิตหลายรายที่บริเวณบ้านเลขที่43หมู่12ต.ทะเลบก จึงรายงานให้ พ.ต.อ.ธนเดช ตันติอาภารอง ผบก.ภ.จว.สุพรรณบุรี และ พ.ต.อ.เอกชัยศรีเมืองผกก.สภ.ดอนเจดีย์ทราบ พร้อมประสานตำรวจชุดพิสูจน์หลักฐาน ภ.จว.สุพรรณบุรี แพทย์เวร รพ.ดอนเจดีย์ มูลนิธิเสมอกันกู้ภัยสุพรรณบุรี เดินทางไปตรวจสอบที่เกิดเหตุ ที่เกิดเหตุ พบศพนายพักตร์ วารีนิล อายุ40ปี อยู่บ้านเลขที่20หมู่ที่2ต.กระเสียว อ.สามชุก จ.สุพรรณบุรี สวมเสื้อยืดสีแดง กางเกงยีนส์ขายาว ตามตัวมีรอยสัก ถูกยิงเข้าที่ ท้อง3นัด กระสุนฝังใน นอนคว่ำหน้าเสียชีวิตอยู่ใต้ชายคาบ้านข้างโต๊ะม้าหินและมีรถ จยย.เวฟ125สีเขียว ทะเบียนขฉษ47สุพรรณบุรีของผู้ตายล้มอยู่และยังพบปืนก๊อก19ตกอยู่ 1 กระบอก และยังพบว่ามีตำรวจชุดสืบสวน สภ.ดอนเจดีย์ บาดเจ็บ2นาย คือ ดต.เอนก หอมเย็นใจ ถูกยิงเข้าที่บริเวณท้องข้างซ้าย บาดเจ็บสาหัสและ ร.ต.ต.ดิเรก รอดฉาย ถูกยิงเข้าที่แขนขวา ถูกนำตัวส่งที่ รพ.เจ้าพระยายมราช ไปก่อนหน้าแล้วและ ด.ต.เอนก ทดพิษบาดแผลไม่ไหวเสียชีวิตในเวลาต่อมา จากการสอบสวนเบื้องต้น ทราบว่า ก่อนเกิดเหตุ พ.ต.ต.ธนกฤตสอดสีสว.สส. หน.ชุด นำกำลัง7คน ได้ทำการติดต่อล่อซื้อยาบ้า1ถุง200เม็ด เป็นเงิน2,000บาท จากนายพักตร์ (ผู้ตาย) โดยติดต่อผ่านทางโทรศัพท์และเฟซบุ๊กและได้นัดส่งของกันที่บ้านหลังดังกล่าว พอถึงเวลานัดหมาย นายพักตร์ (ผู้ตาย) ได้ขี่ จยย.เวฟ125สีเขียว ทะเบียน ขฉษ47สุพรรณเข้ามา เมื่อมาถึงบ้านหลังดังกล่าวและจอดรถลงมานั่งที่โต๊ะม้าหิน ทางตำรวจที่ดักซุ่มอยู่ก็ออกมาแสดงตัว โดย ร.ต.ต.ดิเรก และ ดาบเอนก ได้เข้าไปขอทำการตรวจค้นและให้นายพักตร์ นั่งลงกับพื้น เอามือประสานไว้ที่ท้ายทอย แต่นายพักตร์ กลับฮึดสู้ลุกขึ้นมาชกต่อย ร.ต.ต.ดิเรก และแย่งปืนมา แล้วยิงใส่ตำรวจทั้ง 2 นายทันที จากนั้น ตำรวจที่ตามมาเมื่อเห็นตำรวจทั้ง2 นายถูกยิง จึงได้ยิงใส่ นายพักตร์ ทันทีจนเป็นเหตุให้เสียชีวิตดังกล่าว -009",
